import React from 'react';
import './App.css';

const IncNumber = () => {
  console.log('increment number working');
}

function App() {
  return (
    <>
      <div className="main_content">
        <h1>1</h1>
        <button type="button" onClick="{IncNumber}" >Click</button>
      </div>
    </>
  );
}

export default App;
